import React from "react";
import { Drawer, List, ListItemButton } from "@mui/material";

function Sidebar() {
  return (
    <Drawer
      container={window.document.body}
      variant="permanent"
      open={true}
      sx={{ width: 250, height: "100vh" }}
    >
      <List>
        <ListItemButton>
          <Box></Box>
        </ListItemButton>
      </List>
    </Drawer>
  );
}

export default Sidebar;
